import React, { useState } from 'react';
import axios from 'axios';
import './App.css'; // Assuming you have CSS file for styling

function App() {
  const [movies, setMovies] = useState([
    { id: 1, title: 'Inception', image: 'data:image/jpeg;base64,' },
    { id: 2, title: 'Interstellar', image: 'data:image/jpeg;base64,' },
    { id: 3, title: 'The Dark Knight', image: 'data:image/jpeg;base64,' },
    { id: 4, title: 'Baahubali', image: 'data:image/jpeg;base64,' },                   
    { id: 7, title: 'K.G.F', image: 'data:image/jpeg;base64,' },                  
        
  ]);

  const [selectedMovie, setSelectedMovie] = useState('');
  const [movieImage, setMovieImage] = useState(null);
  const [selectedRow, setSelectedRow] = useState('');
  const [selectedColumn, setSelectedColumn] = useState('');
  const [bookingData, setBookingData] = useState(null);

  const handleMovieSelect = (movie) => {
    setSelectedMovie(movie.title);
    setMovieImage(movie.image);
  };

  const handleBooking = async () => {
    try {
      const data = {
        movie: selectedMovie,
        row: selectedRow,
        column: selectedColumn,
      };

      const response = await axios.post('http://localhost:3000/api/bookTicket', data);

      if (response.status === 200) {
        setBookingData(data);
        alert('Ticket booked successfully!');
      }
    } catch (error) {
      console.error('Error booking ticket:', error);
      alert('Ticket booked successfully!');
    }
  };

  return (
    <div className="app-container">
      <h1 className="header">Movie Ticket Booking</h1>

      <div className="form-container">
        <div className="form-group">
          <label className="form-label">
            Movie:
            <select
              className="form-select"
              onChange={(e) => handleMovieSelect(movies.find(m => m.title === e.target.value))}
            >
              <option value="">Select a movie</option>
              {movies.map(movie => (
                <option key={movie.id} value={movie.title}>{movie.title}</option>
              ))}
            </select>
          </label>
        </div>

        <div className="form-group">
          <label className="form-label">
            Row:
            <input
              className="form-input"
              type="text"
              value={selectedRow}
              onChange={(e) => setSelectedRow(e.target.value)}
            />
          </label>
        </div>

        <div className="form-group">
          <label className="form-label">
            Column:
            <input
              className="form-input"
              type="text"
              value={selectedColumn}
              onChange={(e) => setSelectedColumn(e.target.value)}
            />
          </label>
        </div>

        <button className="btn-book" onClick={handleBooking}>Book Ticket</button>
      </div>

      {bookingData && (
        <div className="booking-details">
          <h2>Booking Details</h2>
          <p>Movie: {bookingData.movie}</p>
          <p>Row: {bookingData.row}</p>
          <p>Column: {bookingData.column}</p>
        </div>
      )}

      {selectedMovie && (
        <div className="movie-preview">
          <h2>Selected Movie: {selectedMovie}</h2>
          {movieImage && <img className="movie-image" src={movieImage} alt={selectedMovie} />}
        </div>
      )}
    </div>
  );
}

export default App;
